import React, {
    useState
} from "react"

const ChangeServerConfig = ()=>{

    const [change, setChange] = useState(false)

    const toggle =()=>{
        setChange((prev)=>!prev)
    }

    const defaultFunc = ()=>{   
        return(
            <>
                <div className="userHomeSegment userHomeChangeConfig">
                        <div className="userHomeChangeServerName userHomeChangeDefaults">
                            <h2>Server Name: </h2>
                            <span>NilsServer</span>
                        </div>
                        <div className="userHomeChangeVersion userHomeChangeDefaults">
                            <h2>Version: </h2>
                            <span>1.16.4</span>
                        </div>
                        <div className="userHomeChangeDifficulty userHomeChangeDefaults">
                            <h2>Difficulty: </h2>
                            <span>Hard</span>
                        </div>
                        <div className="userHomeChangeWhitelist userHomeChangeDefaults">
                            <h2>whitelist: </h2>
                            <span>Nils, Nils2, Nils3, Mini_Pancookies</span>
                        </div>
                        <div className="userHomeChangeOps userHomeChangeDefaults">
                            <h2>ops: </h2>
                            <span>Nils, Nils2, Nils3, Mini_Pancookies</span>
                        </div>
                </div>
                <button className="userHomeChangeBtn" onClick={ toggle }>change</button>
            </>
        );

    }

    const changeFunc = ()=>{
        return(
            <form className="userHomeSegment userHomeChangeConfig">
                <div className="userHomeChangeServerName">

                </div>
                <div className="userHomeChangeVersion">

                </div>
                <div className="userHomeChangeDifficulty">

                </div>
                <div className="userHomeChangeWhitelist">

                </div>
                <div className="userHomeChangeOps">

                </div>
                <button className="userHomeChangeBtn" onClick={ toggle }>save</button>
            </form>
        );
    }


    switch(change){
        case true: 
            return changeFunc()
        default:
            return defaultFunc()
    }
}

export default ChangeServerConfig
